import data from "../../../../data/navBar.json";
import "./NavBar.css";
import NavBarItem from "./NavBarItem";
const NavBar = (props) => {
  return (
    <div className="nav">
      <NavBarItem />
      <ul className="navbar">
        {data.map((item, index) => (
          <span key={index}>
            <li className={item.active ? "active" : ""}>
              <i className={`fas ${item.icon}`} />
              {item.type}
            </li>
          </span>
        ))}
      </ul>
    </div>
  );
};
export default NavBar;
